package com.jc.oa.finance.domain;

import com.jc.foundation.domain.BaseBean;

import java.math.BigDecimal;
import java.util.Date;
/**
 * @author mrb
 * @version 代理费
*/
public class ToaFinanceAgency extends BaseBean {
	
	private static final long serialVersionUID = 1L;
	private String orderNo;//   代理编码	private String customerId;//   客户id	private String customerName;//   客户名称	private String department;//   销售部门	private String sale;//   客户经理	private String maintenanSale;//   维护经理	private Date cycleStart;//   计费周期起	private Date cycleEnd;//   计费周期止	private String cardNo;//   合同编号	private BigDecimal cardAmount;//   合同金额	private Date incontractStart;//   合同周期起时间	private Date incontractEnd;//   合同周期止时间	private String roomName;//   机房	private String resources;//   资源	private String payType;//   支付方式	private BigDecimal beforeTax;//   税前支付金额	private BigDecimal beforeLittle;//   税点	private String paee;//   收款方	private String payState;//   支付状态	private Date payDate;//   支付时间	private BigDecimal notPay;//   未支付金额	private String orderRemark;//   备注	public String getOrderNo() {	    return orderNo;	}	public void setOrderNo(String orderNo) {	    this.orderNo=orderNo;	}	public String getCustomerId() {	    return customerId;	}	public void setCustomerId(String customerId) {	    this.customerId=customerId;	}	public String getCustomerName() {	    return customerName;	}	public void setCustomerName(String customerName) {	    this.customerName=customerName;	}	public String getDepartment() {	    return department;	}	public void setDepartment(String department) {	    this.department=department;	}	public String getSale() {	    return sale;	}	public void setSale(String sale) {	    this.sale=sale;	}	public String getMaintenanSale() {	    return maintenanSale;	}	public void setMaintenanSale(String maintenanSale) {	    this.maintenanSale=maintenanSale;	}	public Date getCycleStart() {	    return cycleStart;	}	public void setCycleStart(Date cycleStart) {	    this.cycleStart=cycleStart;	}	public Date getCycleEnd() {	    return cycleEnd;	}	public void setCycleEnd(Date cycleEnd) {	    this.cycleEnd=cycleEnd;	}	public String getCardNo() {	    return cardNo;	}	public void setCardNo(String cardNo) {	    this.cardNo=cardNo;	}	public BigDecimal getCardAmount() {	    return cardAmount;	}	public void setCardAmount(BigDecimal cardAmount) {	    this.cardAmount=cardAmount;	}	public Date getIncontractStart() {	    return incontractStart;	}	public void setIncontractStart(Date incontractStart) {	    this.incontractStart=incontractStart;	}	public Date getIncontractEnd() {	    return incontractEnd;	}	public void setIncontractEnd(Date incontractEnd) {	    this.incontractEnd=incontractEnd;	}	public String getRoomName() {	    return roomName;	}	public void setRoomName(String roomName) {	    this.roomName=roomName;	}	public String getResources() {	    return resources;	}	public void setResources(String resources) {	    this.resources=resources;	}	public String getPayType() {	    return payType;	}	public void setPayType(String payType) {	    this.payType=payType;	}	public BigDecimal getBeforeTax() {	    return beforeTax;	}	public void setBeforeTax(BigDecimal beforeTax) {	    this.beforeTax=beforeTax;	}	public BigDecimal getBeforeLittle() {	    return beforeLittle;	}	public void setBeforeLittle(BigDecimal beforeLittle) {	    this.beforeLittle=beforeLittle;	}	public String getPaee() {	    return paee;	}	public void setPaee(String paee) {	    this.paee=paee;	}	public String getPayState() {	    return payState;	}	public void setPayState(String payState) {	    this.payState=payState;	}	public Date getPayDate() {	    return payDate;	}	public void setPayDate(Date payDate) {	    this.payDate=payDate;	}	public BigDecimal getNotPay() {	    return notPay;	}	public void setNotPay(BigDecimal notPay) {	    this.notPay=notPay;	}	public String getOrderRemark() {	    return orderRemark;	}	public void setOrderRemark(String orderRemark) {	    this.orderRemark=orderRemark;	}	
}

